import Wrap from "./Wrap";
import Card from "./Card";
import Transfer from "./Transfer";
import Deposit from "./Deposit";
import Withdraw from "./Withdraw";
import Transactions from "./Transactions";
import Personal from "./Personal";
import Password from "./Password";
import Betting from "./Betting";
import FAQ from "./FAQ";

import QR from "./agency/QR";
import AgentReport from "./agency/AgentReport";
import ComissionReport from "./agency/ComissionReport";
import Members from "./agency/Members";

import Birthdate from "./personal/Birthdate";
import Cellphone from "./personal/Cellphone";
import Email from "./personal/Email";
import Fullname from "./personal/Name";

import * as Service from "../../../service";

export {
  Service,
  Wrap,
  Card,
  Transfer,
  Deposit,
  Withdraw,
  Transactions,
  Personal,
  Password,
  Betting,
  FAQ,
  QR,
  AgentReport,
  ComissionReport,
  Members,
  Birthdate,
  Cellphone,
  Email,
  Fullname,
};
